INSERT INTO `emailtemplates`(`id`,`subject`,`body`) VALUES(1,'Notification of Repair for {PRODUCT}. Your Repair Service {RMA} is completed.Notification of Repair for {PRODUCT}. Your Repair Service {RMA} is completed.','Dear {CUSTOMER}, this is to inform you that your repair order with RMA ID:{RMA} for product {PRODUCT} has completed and it''s ready for pickup from our repair shop.'),(2,'Cost quote for your Repair','This is to inform you about the cost of your repair.'),(3,'No fault found for your repair','This is to inform you that we have no found any problem with your repair.'),(4,'Unit is Replaced','This is to inform you that your unit has replaced and will sent back to you soon.'),(9,'RMA Finished','<p>Dear {CUSTOMER},<br /><br />We finished your {RMA} {PRODUCT} {SERIAL}.<br /><br />The total cost of your repair is: {COST}. <br /><br />If you have any questions you can contact us. <br /><br /></p><p>&nbsp;</p><p>{TECHNICIAN}</p><p><strong><span style=\"font-size: 10.0pt;\">Service department</span></strong><br />');
