DROP TABLE IF EXISTS `product_service`;
CREATE TABLE IF NOT EXISTS `product_service` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `productId` int(10) unsigned NOT NULL,
  `serviceId` bigint(20) unsigned NOT NULL,
  `description` varchar(255) DEFAULT NULL,
  `qty` decimal(8,2) DEFAULT NULL,
  `unitPrice` decimal(8,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_service_productservice_idx` (`serviceId`),
  KEY `fk_product_service_product_idx` (`productId`),
  CONSTRAINT `product_service_ibfk_1` FOREIGN KEY (`productId`) REFERENCES `product` (`id`),
  CONSTRAINT `product_service_product_ibfk_1` FOREIGN KEY (`serviceId`) REFERENCES `services` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=336 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;

