DROP PROCEDURE IF EXISTS `prc_report_summary`;
DELIMITER |
CREATE PROCEDURE `prc_report_summary`(p_date_from varchar(20), p_date_to varchar(20))
BEGIN
SELECT
FORMAT( inv.total_labour_cost, 2 ) AS total_invoice_labour_cost,
FORMAT( inv.total_product_cost, 2 ) AS total_invoice_product_cost,
FORMAT( inv.total_item_tax_1, 2 ) AS total_invoice_item_tax_1,
FORMAT( inv.total_item_tax_2, 2 ) AS total_invoice_item_tax_2,
FORMAT( inv.total_item_tax_3, 2 ) AS total_invoice_item_tax_3,
FORMAT( inv.total_wide_taxes_1, 2 ) AS total_invoice_wide_taxes_1,
FORMAT( inv.total_wide_taxes_2, 2 ) AS total_invoice_wide_taxes_2,
FORMAT( inv.total_wide_taxes_3, 2 ) AS total_invoice_wide_taxes_3,
FORMAT( inv.Total_amount_invoice, 2 ) AS Total_amount_invoice,
inv.Total_invoice,
FORMAT( inv.total_surcharge_1, 2 ) AS total_invoice_surcharge_1,
FORMAT( inv.total_surcharge_2, 2 ) AS total_invoice_surcharge_2,
FORMAT( cm.total_credit_memo_item_tax_1, 2 ) AS total_credit_memo_item_tax_1,
FORMAT( cm.total_credit_memo_item_tax_2, 2 ) AS total_credit_memo_item_tax_2,
FORMAT( cm.total_credit_memo_item_tax_3, 2 ) AS total_credit_memo_item_tax_3,
FORMAT( cm.total_credit_memo_wide_taxes_1, 2 ) AS total_credit_memo_wide_taxes_1,
FORMAT( cm.total_credit_memo_wide_taxes_2, 2 ) AS total_credit_memo_wide_taxes_2,
FORMAT( cm.total_credit_memo_wide_taxes_3, 2 ) AS total_credit_memo_wide_taxes_3,
FORMAT( cm.Total_amout_credit_memo, 2 ) AS Total_amout_credit_memo,
FORMAT( cm.total_credit_memo_surcharge_1, 2 ) AS total_credit_memo_surcharge_1,
FORMAT( cm.total_credit_memo_surcharge_2, 2 ) AS total_credit_memo_surcharge_2,
cm.total_credit_memo,
FORMAT( rc.total_item_tax_1, 2 ) AS total_receipt_item_tax_1,
FORMAT( rc.total_item_tax_2, 2 ) AS total_receipt_item_tax_2,
FORMAT( rc.total_item_tax_3, 2 ) AS total_receipt_item_tax_3,
FORMAT( rc.total_wide_taxes_1, 2 ) AS total_receipt_wide_taxes_1,
FORMAT( rc.total_wide_taxes_2, 2 ) AS total_receipt_wide_taxes_2,
FORMAT( rc.total_wide_taxes_3, 2 ) AS total_receipt_wide_taxes_3,
FORMAT( rc.subtotal, 2 ) AS receipt_subtotal,
FORMAT( rc.Total_amount_receipt, 2 ) AS Total_amount_receipt,
FORMAT( rc.total_surcharge_1, 2 ) AS total_receipt_surcharge_1,
FORMAT( rc.total_surcharge_2, 2 ) AS total_receipt_surcharge_2,
rc.Total_receipt,
FORMAT( pm.total_payment_amount, 2 ) AS total_payment_amount,
pm.total_payment,
FORMAT( inv.Total_amount_invoice - pm.Total_payment_amount - cm.Total_amout_credit_memo, 2 ) AS balance,
FORMAT( inv.Total_amount_invoice + Total_amount_receipt, 2 ) AS total_sales
FROM
(
SELECT
SUM( total_labour_cost ) AS total_labour_cost,
SUM( total_product_cost ) AS total_product_cost,
SUM( total_item_tax_1 ) AS total_item_tax_1,
SUM( total_item_tax_2 ) AS total_item_tax_2,
SUM( total_item_tax_3 ) AS total_item_tax_3,
SUM( total_wide_taxes_1 ) AS total_wide_taxes_1,
SUM( total_wide_taxes_2 ) AS total_wide_taxes_2,
SUM( total_wide_taxes_3 ) AS total_wide_taxes_3,
SUM( Total ) AS Total_amount_invoice,
COUNT( invoicenum ) AS Total_invoice,
SUM( total_surcharge_1 ) AS total_surcharge_1,
SUM( total_surcharge_2 ) AS total_surcharge_2
FROM
(
SELECT
SUM( CASE WHEN type IN ( 'Labor', 'Labour' ) THEN subtotal_after_discount ELSE 0 END ) AS total_labour_cost,
SUM( CASE WHEN type = 'Product' THEN subtotal_after_discount ELSE 0 END ) AS total_product_cost,
SUM( ii.tax1 ) AS total_item_tax_1,
SUM( ii.tax2 ) AS total_item_tax_2,
SUM( ii.tax3 ) AS total_item_tax_3,
MAX( i.tax1 ) AS total_wide_taxes_1,
MAX( i.tax2 ) AS total_wide_taxes_2,
MAX( i.tax3 ) AS total_wide_taxes_3,
SUM( ii.subtotal_after_discount ) AS subtotal,
MAX( i.total ) AS Total,
MAX( i.custom_surcharge1 ) AS total_surcharge_1,
MAX( i.custom_surcharge2 ) AS total_surcharge_2,
i.invoicenum,
DATE_FORMAT( i.date, "%d/%m/%Y" ) AS date,
CONCAT( c.fname, ' ', c.lname ) AS full_name
FROM
invoice_items ii
INNER JOIN invoice i ON i.id = ii.invoice_id
INNER JOIN customers c ON i.customerid = c.id
WHERE
i.status_name = 'Issued'
AND CAST( i.date AS DATE ) BETWEEN p_date_from
AND p_date_to
GROUP BY
i.invoicenum,
i.date,
CONCAT( c.fname, ' ', c.lname )
) d1
) inv,
(
SELECT
SUM( total_credit_memo_item_tax_1 ) AS total_credit_memo_item_tax_1,
SUM( total_credit_memo_item_tax_2 ) AS total_credit_memo_item_tax_2,
SUM( total_credit_memo_item_tax_3 ) AS total_credit_memo_item_tax_3,
SUM( total_credit_memo_wide_taxes_1 ) AS total_credit_memo_wide_taxes_1,
SUM( total_credit_memo_wide_taxes_2 ) AS total_credit_memo_wide_taxes_2,
SUM( total_credit_memo_wide_taxes_3 ) AS total_credit_memo_wide_taxes_3,
SUM( Total_amout_credit_memo ) AS Total_amout_credit_memo,
SUM( total_credit_memo_surcharge_1 ) AS total_credit_memo_surcharge_1,
SUM( total_credit_memo_surcharge_2 ) AS total_credit_memo_surcharge_2,
COUNT( credit_memo_num ) AS total_credit_memo
FROM
(
SELECT
SUM( cmi.tax1 ) AS total_credit_memo_item_tax_1,
SUM( cmi.tax2 ) AS total_credit_memo_item_tax_2,
SUM( cmi.tax3 ) AS total_credit_memo_item_tax_3,
MAX( cm.tax1 ) AS total_credit_memo_wide_taxes_1,
MAX( cm.tax2 ) AS total_credit_memo_wide_taxes_2,
MAX( cm.tax3 ) AS total_credit_memo_wide_taxes_3,
MAX( cm.total ) AS Total_amout_credit_memo,
MAX( cm.custom_surcharge1 ) AS total_credit_memo_surcharge_1,
MAX( cm.custom_surcharge2 ) AS total_credit_memo_surcharge_2,
cm.credit_memo_num
FROM
credit_memo cm
INNER JOIN credit_memo_items cmi ON cm.id = cmi.credit_memo_id
INNER JOIN customers c ON cm.customerid = c.id
WHERE
CAST( date_created AS DATE ) BETWEEN p_date_from
AND p_date_to
AND cm.credit_memo_status = 'Issued'
GROUP BY
cm.credit_memo_num
) d2
) cm,
(
SELECT
SUM( total_item_tax_1 ) AS total_item_tax_1,
SUM( total_item_tax_2 ) AS total_item_tax_2,
SUM( total_item_tax_3 ) AS total_item_tax_3,
SUM( total_wide_taxes_1 ) AS total_wide_taxes_1,
SUM( total_wide_taxes_2 ) AS total_wide_taxes_2,
SUM( total_wide_taxes_3 ) AS total_wide_taxes_3,
SUM( subtotal ) AS subtotal,
SUM( Total ) AS Total_amount_receipt,
SUM( total_surcharge_1 ) AS total_surcharge_1,
SUM( total_surcharge_2 ) AS total_surcharge_2,
COUNT( receiptnum ) AS Total_receipt
FROM
(
SELECT
SUM( ri.tax1 ) AS total_item_tax_1,
SUM( ri.tax2 ) AS total_item_tax_2,
SUM( ri.tax3 ) AS total_item_tax_3,
MAX( r.tax1 ) AS total_wide_taxes_1,
MAX( r.tax2 ) AS total_wide_taxes_2,
MAX( r.tax3 ) AS total_wide_taxes_3,
SUM( ri.subtotal_after_discount ) AS subtotal,
MAX( r.total ) AS Total,
MAX( r.custom_surcharge1 ) AS total_surcharge_1,
MAX( r.custom_surcharge2 ) AS total_surcharge_2,
r.receiptnum,
DATE_FORMAT( r.date, "%d/%m/%Y" ) AS date,
CONCAT( c.fname, ' ', c.lname ) AS full_name
FROM
receipt r
INNER JOIN receipt_items ri ON r.id = ri.receipt_id
INNER JOIN customers c ON r.customerid = c.id
WHERE
CAST(date as DATE) between p_date_from and p_date_to
AND r.status_name = 'Issued'
GROUP BY
r.receiptnum,
r.date,
CONCAT( c.fname, ' ', c.lname )) d3
) rc,
(
SELECT
SUM( amount ) AS total_payment_amount,
COUNT( payment_number ) AS total_payment
FROM
(
SELECT
ip.payment_number,
DATE_FORMAT( ip.payment_date, "%d/%m/%Y" ) AS date,
COALESCE ( i.invoicenum, 'No Invoice Associate' ) AS paid_for_invoice_num,
CONCAT( c.fname, ' ', c.lname ) AS full_name,
pm.payment_method_name,
ip.amount AS amount,
ip.notes
FROM
invoice_payment ip
INNER JOIN customers c ON ip.customer_id = c.id
LEFT JOIN invoice i ON ip.invoice_id = i.id
INNER JOIN payment_methods pm ON ip.payment_method_id = pm.payment_method_id
WHERE
CAST( ip.payment_date AS DATE ) BETWEEN p_date_from
AND p_date_to
) d4
) pm;
END |
DELIMITER ;

