DELIMITER |
CREATE PROCEDURE `prd_service_summary`()
BEGIN
SELECT
dtl.id,
date( dtl.opendate ),
dtl.finished_date,
dtl.technician,
dtl.supplier,
dtl.warranty,
dtl.custom1,
dtl.custom2,
dtl.custom3,
dtl.custom4,
dtl.custom5,
dtl.custom6,
dtl.custom7,
dtl.custom8,
dtl.custom9,
dtl.custom10,
dtl.rmaid,
dtl.clientid,
dtl.clientname,
dtl.phone,
dtl.mobile,
dtl.machinetype,
dtl.serialnumber,
dtl.rma_status,
dtl.CODE,
dtl.description,
dtl.unitPrice,
dtl.storeid,
dtl.NAME AS storeName,
dtl.qty,
SUM( dtl.labourcost ) AS labourcost,
SUM( dtl.productcost ) AS productcost,
case when @service_id<>id then dtl.supplier_cost else 0 end as supplier_cost,
@service_id:=dtl.id,
case when @service_id<>id then dtl.supplier_cost else 0 end + SUM( dtl.labourcost )+ SUM( dtl.productcost ) AS totalcost
FROM
(
SELECT
s.id,
s.opendate,
s.finished_date,
s.technician,
s.supplier,
s.warranty,
s.custom1,
s.custom2,
s.custom3,
s.custom4,
s.custom5,
s.custom6,
s.custom7,
s.custom8,
s.custom9,
s.custom10,
s.rmaid,
s.clientid,
s.clientname,
s.phone,
s.mobile,
s.machinetype,
s.serialnumber,
s.rma_status,
s.supplier_cost,
s.storeid,
p.CODE,
p.product_type,
st.NAME,
ps.description,
ps.unitPrice,
COALESCE ( ps.qty, 0 ) AS qty,
CASE
WHEN trim(
lower( p.product_type ))= 'labour' THEN
COALESCE ( ps.unitprice, 0 )* COALESCE ( ps.qty, 0 ) ELSE 0
END AS labourcost,
CASE
WHEN trim(
lower( p.product_type ))= 'product' THEN
COALESCE ( ps.unitprice, 0 )* COALESCE ( ps.qty, 0 ) ELSE 0
END AS productcost
FROM
services s
LEFT JOIN product_service ps ON s.id = ps.serviceid
LEFT JOIN product p ON ps.productid = p.id
INNER JOIN stores st ON s.storeid = st.id
) dtl,(select @service_id:=0) r
GROUP BY
dtl.id,
date( dtl.opendate ),
dtl.finished_date,
dtl.technician,
dtl.supplier,
dtl.warranty,
dtl.custom1,
dtl.custom2,
dtl.custom3,
dtl.custom4,
dtl.custom5,
dtl.custom6,
dtl.custom7,
dtl.custom8,
dtl.custom9,
dtl.custom10,
dtl.rmaid,
dtl.clientid,
dtl.clientname,
dtl.phone,
dtl.mobile,
dtl.machinetype,
dtl.serialnumber,
dtl.rma_status,
dtl.supplier_cost,
dtl.CODE,
dtl.description,
dtl.unitPrice,
dtl.qty,
dtl.storeid,
dtl.NAME;
END |
