CREATE TRIGGER trg_at_insert_service
    AFTER INSERT ON services
    FOR EACH ROW

BEGIN
    insert into services_status_history(service_id,status_id,status_name)
	values (NEW.id,NEW.statusid,NEW.rma_status);
END |
