DROP TRIGGER /*!50030 IF EXISTS */ `trg_at_update_service`;
DELIMITER |
CREATE TRIGGER trg_at_update_service
    AFTER UPDATE ON services
    FOR EACH ROW
BEGIN
DECLARE v_cnt INT;
	IF NEW.statusid<>OLD.statusid AND NEW.rma_status<>OLD.rma_status THEN
    BEGIN
		-- check existing status
		SELECT COUNT(1) 
		INTO v_cnt
		FROM services_status_history
		WHERE service_id=NEW.id
		AND status_id=NEW.statusid;
		-- insert update
		IF v_cnt = 0 THEN
			insert into services_status_history(service_id,status_id,status_name)
			values (NEW.id,NEW.statusid,NEW.rma_status);
		ELSE
			update services_status_history
			set status_name = NEW.rma_status			
			where service_id=OLD.id
			and status_id=OLD.statusid;
		END IF;
    END;
    END IF;
END |
DELIMITER ;


